import React, {useState} from 'react'
import SvgComponent from './components/Flecha';
import ReactMapGL, {Marker, GeolocateControl} from 'react-map-gl';
import 'mapbox-gl/dist/mapbox-gl.css';


function App() {
    let angleOrigin=0;
    const geolocateControlStyle = {
        right: 10,
        top: 10
      };
    const [viewport, setViewport] = useState({
        latitude: -1.264417,
        longitude: -78.608275,
        zoom: 10,
        width: "100vw",
        height: "100vh"
    });
    const [pointOrigin, setPointorigin] = useState({
        latitude: 1.50112,
        longitude: 2.24530
    })
    const [pointEnd, setPointEnd] = useState({
        latitude: -1.15327,
        longitude: 1.04242
    })
    const [pointNew, setPointNew] = useState({
        latitude: 0,
        longitude: 0
    })
    return (

        <div>
            <ReactMapGL {...viewport}
                mapboxApiAccessToken={
                    process.env.REACT_APP_MAPBOX_TOKEN
                }
                onViewportChange={
                    viewport => {
                        setViewport(viewport);
                    }
            }>
                <GeolocateControl style={geolocateControlStyle}
                    positionOptions={
                        {enableHighAccuracy: true}
                    }
                    trackUserLocation={true}
                    auto></GeolocateControl>
                <Marker latitude={0}
                    longitude={0}>
                    <SvgComponent transform={`rotate(${angleOrigin} )`}/>
                </Marker>
                <Marker latitude={1.50112}
                    longitude={2.24530}>
                    <SvgComponent transform={`rotate(${56.23486} )`}/>
                </Marker>
                <Marker latitude={-1.15327}
                    longitude={1.04242}>
                    <SvgComponent transform={`rotate(${-155.62157} )`}/>
                </Marker>
            </ReactMapGL>
        </div>


    );
}

export default App;
